import './index.css';
// import Headers  from './emoji';
class inputlist extends Component {
	constructor(props) {
		super(props);

		this.state = { a: 'twinkle',
	 };
	}
	handleInputChange = (event) => {
		this.setState({
			query: event.target.value
		});
	};


	render() {
		return (
			<form>
				<input  onChange={this.handleInputChange} className="searchinput" />
				<p />
			</form>
		);
	}
}

